import React from 'react';
const footer_logo = `${process.env.PUBLIC_URL}/img/footer-logo.png`;

function Footer(props) {
    return (
        <div className='Footer'>
            <img src={footer_logo} />
            <p className='Footer-Title'></p>
        </div>
    );
}

export default Footer;
